/* Trending.jsx */
import React from 'react';
import './Trending.css';

const Trending = ({ knives }) => {
    return (
        <div className="trending">
            <h1>Trending Knives</h1>
            <div className="trending-item">
                {knives.map(knife => (
                    <div key={knife.id}>
                        <div className="knife-name">{knife.name}</div>
                        <div className="knife-price">${knife.knife_price}</div>
                        <img src={knife.image} alt={knife.name} />
                    </div>
                ))}
            </div>
            <div className="pagination">
                {/* Pagination controls go here */}
            </div>
        </div>
    );
};

export default Trending;
